ReactDOM.render(
                <>
                <h1>List of Top 5 Netflix web Series</h1>
                  {Sdata.map( (val)=>{
                                       return( <Card imgSrc={val.img} 
                                                title={val.title}
                                                sname={val.name} 
                                                link={val.link}/>
                                          );
                                    } 
                            )
                  }

                </>,
                document.getElementById("root")

);
